import axios from 'axios';
let hostname = 'http://localhost:8081';


let register = (user) => {
    return axios.post(`${hostname}/user/signup`,user)
}


let getEmailValid = (email) => {
    return axios.post(`${hostname}/user/emailCheck`,{email:email})
}

export const userService = {
    register,
    getEmailValid
};
